import Header from './Header'; // Import Header component
import './Quiz.css'; // Import your Quiz specific CSS if needed

function Quiz({ navigateTo }) {
  return (
    <div className="Quiz">
      <Header navigateTo={navigateTo} /> {/* Render Header with navigation */}
      {/* Your Quiz content goes here */}
      <h1>Quiz Page</h1>
      {/* Add your quiz content here */}
    </div>
  );
}

export default Quiz;
